(3, 'Pro', 'Power up with advanced features, premium support, and full flexibility. Designed for professionals who need performance, control, and reliability—without limits.', 29.00, 30, '[\"Unlimited VCards\",\"Unlimited VCard blocks\",\"Unlimited Projects\",\"20 Pixels\",\"20 Custom domains\",\"Stats advanced\",\"Unlimited additional domains\",\"Included Advanced Analytics\",\"Password Protection (2FA)\",\"Removable Branding\",\"QR Code builder\",\"Unlimited custom back-half URLs\",\"Custom CSS/JS injection\",\"Unlimited API Keys\",\"Webhook integration\",\"No Ads\"]', 1, 0, '2025-05-06 11:20:25');

